import sys

def count_trailing_zeros(n):
    count = 0
    while n > 0:
        n //= 5
        count += n
    return count

def find_n_for_m_zeros(m):
    low = 0
    high = 5 * m
    result = []

    while low <= high:
        mid = (low + high) // 2
        zeros = count_trailing_zeros(mid)
        if zeros < m:
            low = mid + 1
        elif zeros > m:
            high = mid - 1
        else:
            # Find the first occurrence of m zeros
            first = mid
            while first > 0 and count_trailing_zeros(first) == m:
                first -= 1
            first += 1
            # Find the last occurrence of m zeros
            last = mid
            while last > 0 and count_trailing_zeros(last) == m:
                last += 1
            last -= 1
            result = list(range(first, last + 1))
            break

    return result

def main():
    m = int(sys.stdin.readline())
    result = find_n_for_m_zeros(m)
    print(len(result))
    if result:
        print(' '.join(map(str, result)))

if __name__ == "__main__":
    main()
